        public static string ImplementThis(string s)
        {
            var freq = new Dictionary<char, int>();
            foreach (var c in s)
            {
                if (freq.ContainsKey(c)) freq[c] += 1;
                else freq.Add(c, 1);
            }
            var freqCount = new Dictionary<int, int>();
            foreach (var kvp in freq)
            {
                if (freqCount.ContainsKey(kvp.Value)) freqCount[kvp.Value] += 1;
                else freqCount.Add(kvp.Value, 1);
            }

            if (freqCount.Count == 1) return "YES";
            if (freqCount.Count != 2) return "NO";
            var maxKey = freqCount.Keys.Max();
            var minKey = freqCount.Keys.Min();
            if (freqCount.Values.Contains(1) && (freqCount[minKey] == 1 || maxKey - minKey == 1)) return "YES";
            return "NO";
        }

