        private static string GenerateRandomString(int length, bool valid)
        {
            var alphabet = "ab";
            StringBuilder str = new StringBuilder();
            var tries = 0;
            do
            {
                for (int i = 0; i < length; i++)
                {
                    str.Append(alphabet[Random.Shared.Next(alphabet.Length)]);
                }
                tries++;
            } while (tries < 10000 && valid && ImplementThis(str.ToString()) == "NO");
            if (tries >= 10000) return "FAILED";
            return str.ToString();
        }

        private static string MeasureMethod(string input)
        {
            var stopwatch = new Stopwatch();

            var ticks = 0L;
            var output = "";
            var accummulatedTime = TimeSpan.Zero;
            output = ImplementThis(input);
            for (int i = 0; i < 5000; i++)
            {
                try
                {
                    stopwatch.Start();
                    output = ImplementThis(input);
                    stopwatch.Stop();
                    accummulatedTime += stopwatch.Elapsed;
                }
                finally
                {
                    stopwatch.Reset();
                }
            }

            ticks = (accummulatedTime / 5000).Ticks;

            return $"{ticks}|{input}|{output}";
        }
